import React from 'react';
import { Card, CardContent, Typography, Box } from '@mui/material';

const IncomeCard = ({ monthlyIncome }) => {
    return (
        <Card sx={{ width: 1, mt: 10, mb: 2, boxShadow: 3 }}>
            <CardContent>
                <Typography variant="h6" gutterBottom>
                    Monthly Income
                </Typography>
                <Typography variant="h4">
                    ${monthlyIncome}
                </Typography>
                
                {/* Placeholder for LineChart */}
                <Box sx={{ height: '150px', mt: 2, bgcolor: 'action.hover' }}>
                    Chart goes here
                </Box>
            </CardContent>
        </Card>
    );
}

export default IncomeCard;
